#include <iostream>
using namespace std;

void sort(int a[], int n) {
    if (n <= 1) return;
    int i = 0, j = n - 1;
    while (i < j) {
        if (a[i] > a[j]) swap(a[i], a[j]);
        i++;
        j--;
    }
}

void timsort(int a[], int n) {
    if (n <= 1) return;
    int i = 0, j = n - 1;
    while (i < j) {
        if (a[i] > a[j]) {
            swap(a[i], a[j]);
            i++;
        } else {
            j--;
        }
    }
}

int main() {
    int a[] = {2, 3, 5, 7};
    int n = sizeof(a)/sizeof(a[0]);
    cout << "Before sorting:" << endl;
    for (int i = 0; i < n; ++i) {
        cout << a[i] << " ";
    }
    cout << endl;
    sort(a, n);
    cout << "After sorting:" << endl;
    for (int i = 0; i < n; ++i) {
        cout << a[i] << " ";
    }
    cout << endl;
    timsort(a, n);
    cout << "After timsort:" << endl;
    for (int i = 0; i < n; ++i) {
        cout << a[i] << " ";
    }
    cout << endl;
    return 0;
}
